	add("auteur", "{\"term\":\"auteur\", \"etymology\":{\"influencers\":[{}], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}} \u0027auteur\u0027 (author) Popularised by {{w|François Truffaut}} in the 1954 essay “Une certaine tendance du cinéma français” (“A certain tendency in French cinema”) in the influential film journal \u0027{{w|Cahiers du cinéma}}\u0027 as the phrase “la politique des Auteurs”.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A creative artist, especially a film director, seen as having a specific, recognisable artistic vision, and who is seen as the single or preeminent ‘author’ of his works\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1974\u0027\u0027, William Bender, \u0026quot;Call to vespers\u0026quot;, \u0027Time\u0027, 11 Feb 1974\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The libretto was a piece of hack work from a Parisian scenario factory run by an enterprising \u0027\u0027auteur\u0027\u0027 of sorts named Eugene Scribe\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, \u0026quot;Broadway is bigger than ever\u0026quot;, \u0027The Economist\u0027, 24 Apr 2003\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Since Mr Luhrmann first tackled the opera, he has entered the select circle of celebrity directors on the basis of only three films, including “Moulin Rouge”. And his “La Bohème”—designed by Mrs Luhrmann, Catherine Martin, a double Oscar-winner for “Moulin Rouge”—is avowedly the work of an \u0027\u0027\u0027auteur\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Jane Graham, \u0027The Guardian\u0027, 23 Jun 2011\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"If a widely respected \u0027\u0027auteur\u0027\u0027 such as Martin Scorsese, Allen or Malick has given you the stamp of approval, you might not live fast or die young, but you\u0027ll leave a good-looking legacy\", \"priority\":7}]}, \"synonyms\":{}}");

