	add("authenticism", "{\"term\":\"authenticism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|authentic|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A belief in the superiority of the authentic over the inauthentic\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Allene Cooper, \u0026quot;Science and the Reception of Poetry in Postbellum American Journals,\u0026quot; \u0027American Periodicals \u0027, Vol. 4, p. 44 n4\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Sinclair Lewis claimed that American letters exemplified a divorce of intellectual life from \u0027\u0027authenticism\u0027\u0027 and reality\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Jonathan Shull, \u0026quot;Locating the Past in the Present: Living Traditions and the Performance of Early Music,\u0026quot; \u0027Ethnomusicology Forum\u0027, Vol. 15, No. 1, p. 91\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"If performers of Early Music—and especially medieval music—could no longer appeal to an unattainable authenticity, they could nevertheless adhere unabashedly and tenaciously to the values and precepts that spawned \u0027\u0027authenticism\u0027\u0027 in the first place, namely a comprehension of, and a stalwart respect for, the historical place of their repertoire and the empowerment which accompanies such knowledge\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Megan Swift, \u0026quot;‘The Tale’ and the Novel: Pasternak and the Politics of Genre,\u0026quot; \u0027Canadian Slavonic Papers\u0027, Vol. 49, No. 1/2 (March-June), p. 121\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Pasternak portrays art as \u0027iskusstvo-vran\u0027e\u0027, the art that deceives, defending it against Lef\u0027s demands for a crude \u0027\u0027authenticism\", \"priority\":7}]}, \"synonyms\":{}}");

