	add("authority", "{\"term\":\"authority\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Middle english (1100-1500) \u0027autorite|lang\u003denm\u0027 () from Old french (842-ca. 1400) \u0027auctorité\u0027 from Latin stem of \u0027auctoritas\u0027 (lang\u003dla) from \u0027auctor\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The power to enforce rules or give orders\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1883\u0027\u0027, \u0027\u0027 s:The Merry Adventures of Robin Hood/Chapter Chapter\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But in the meantime Robin Hood and his band lived quietly in Sherwood Forest, without showing their faces abroad, for Robin knew that it would not be wise for him to be seen in the neighborhood of Nottingham, those in \u0027\u0027authority\u0027\u0027 being very wroth with him\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Persons in command; specifically, government\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/leaders/21583270-new-zealands-plan-regulate-designer-drugs-better-trying-ban-them-and-failing-new Legal highs: A new passage\u003dNo sooner has a [synthetic] drug been blacklisted than chemists adjust their recipe and start churning out a subtly different one. These \u0026amp;ldquo;legal highs\u0026amp;rdquo; are sold for the few months it takes the \u0027\u0027authorities\u0027\u0027 to identify and ban them, and then the cycle begins again\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A person accepted as a source of reliable information on a subject\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1930\u0027\u0027 September 18, Albert Einstein, as quoted in \u0027Albert Einstein: Creator and Rebel\u0027 (1988) by Banesh Hoffma\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"To punish me for my contempt of \u0027\u0027authority\u0027\u0027, Fate has made me an \u0027\u0027authority\u0027\u0027 myself\", \"priority\":8}]}, \"synonyms\":{}}");

