	add("autoecism", "{\"term\":\"autoecism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Derived from \u0027autoecious\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The fact of completing an entire life cycle on a single host species\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1972\u0027\u0027, B. K. Bakshi, \u0027Relative Blister Rust Resistance of Native and Introduced White Pines in Asia\u0027, North Atlantic Treaty Organization, International Union of Forestry Research Organizations, US Forest Service, University of Idaho, \u0027Biology of Rust Resistance in Forest Trees: Proceedings of a NATO-IUFRO Advanced Study Institute\u0027, [http://books.google.com.au/books?id\u003dS0Rv361h2S0C\u0026amp;pg\u003dPA253\u0026amp;dq\u003d%22autoecism%22%7C%22autoecisms%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dhvlcUs3nOMTDkgXy1IB4\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22autoecism%22%7C%22autoecisms%22\u0026amp;f\u003dfalse page 254\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"This may possibly be explained by \u0027\u0027autoecism\u0027\u0027 (pine-to-pine spread) in the aecial stage of the rust, but \u0027\u0027autoecism\u0027\u0027 has not been conclusively proved (Spaulding, l922\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Salvatore Moricca, Alessandro Ragazzi, Gemma Assante, \u0027Biocontrol of Rust Fungi by Cladosporium tenuissimum\u0027, Ming Hao Pei, Alistair R. McCracken (editors), \u0027Rust Diseases of Willow and Poplar\u0027, [http://books.google.com.au/books?id\u003doeCTeUGNuqEC\u0026amp;pg\u003dPA215\u0026amp;dq\u003d%22autoecism%22%7C%22autoecisms%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dhvlcUs3nOMTDkgXy1IB4\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22autoecism%22%7C%22autoecisms%22\u0026amp;f\u003dfalse page 215\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Other measuresare deficient because of the large geographic distribution of the pathogens, their wide host ranges, their high spore dispersal capabilities, and the \u0027\u0027autoecism\u0027\u0027 of some rusts\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The fact of having male and female reproductive organs on the same individual plant\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1911\u0027\u0027, \u0027Bulletin of the New York Botanical Garden\u0027, [http://books.google.com.au/books?id\u003dSsszAQAAMAAJ\u0026amp;q\u003d%22autoecism%22%7C%22autoecisms%22\u0026amp;dq\u003d%22autoecism%22%7C%22autoecisms%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dhvlcUs3nOMTDkgXy1IB4\u0026amp;redir_esc\u003dy page 406\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Along with this view of pleomorphism, goes the generally conceived idea that \u0027\u0027autoecism\u0027\u0027 is the primitive condition, heteroecism being considered a later adaptation (Klebahn, 1904\", \"priority\":10}]}, \"synonyms\":{}}");

	add("autoerotica", "{\"term\":\"autoerotica\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"autoerotic activity or material\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Wendy Northcutt, \u0027The Darwin Awards: Evolution in Action\u0027 (volume 1, page 272\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Needless to say, the guy paid dearly for his little experiment in \u0027\u0027autoerotica\u0027\u0027, and probably will never experience the joy of a jump rope in quite the same way\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Bryan Young, \u0027Lost at the Con\u0027 (page 80\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I couldn\u0027t even fathom what sort of sci-fi themed \u0027\u0027autoerotica\u0027\u0027 might be on display for the perverted and sexually repressed masses that this sort of event obviously attracts\", \"priority\":5}]}, \"synonyms\":{}}");

