	add("autofire", "{\"term\":\"autofire\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|auto|fire|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A feature on a joystick that permits automatic firing, as though the player were repeatedly pressing the fire button\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027, \u0027Operation Wolf\u0027 (review), \u0027Crash\u0027 issue 59 (December 1988\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"You start off with just seven clips of ammo and five grenades \u0026amp;mdash; so all you \u0027\u0027autofire\u0027\u0027 merchants are in trouble. Only real soldiers, with an accurate eye and careful trigger finger need apply here\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1989\u0027\u0027, \u0027Popular Mechanics\u0027 (volume 166, number 10, October 1989\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"High-speed \u0027\u0027autofire\u0027\u0027 and a choice of two joystick sizes are featured\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027, \u0027Letters\u0027, \u0027Your Sinclair\u0027 issue 51 (March 1990\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Also the crappy joystick, the SJ51, is useless. It\u0027s as stiff as a Skoda\u0027s steering and there\u0027s no \u0027\u0027autofire\u0027\u0027 on it. I can\u0027t help thinking that I made the worst investment of my life by buying this computer\", \"priority\":7}]}, \"synonyms\":{}}");

