	add("automaker", "{\"term\":\"automaker\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|auto|maker|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who manufactures automobiles; typically used to refer to a large corporation such as General Motors\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Amory B. Lovins, E. Kyle Datta, Odd-Even Bustnes, Jonathan G. Koomey, Nathan J. Glasgow, \u0027Winning the Oil Endgame: Innovation for Profits, Jobs and Security\u0027, [http://books.google.com.au/books?id\u003dXQnRfOn9aaYC\u0026amp;pg\u003dPA136\u0026amp;dq\u003d%22automaker%22%7C%22automakers%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dcv08U8b0DYbekgWPlIGgCQ\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22automaker%22%7C%22automakers%22\u0026amp;f\u003dfalse page 136\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"With such competition looming, one might suppose that U.S. \u0027\u0027automakers\u0027\u0027 would embrace tighter domestic efficiency requirements to help them gird for the challenge\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Brian Munroe, \u0027Car Buying Revealed: How to Buy a Car and Not Get Taken for a Ride\u0027, [http://books.google.com.au/books?id\u003dBR8NekkesawC\u0026amp;pg\u003dPA9\u0026amp;dq\u003d%22automaker%22%7C%22automakers%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dcv08U8b0DYbekgWPlIGgCQ\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22automaker%22%7C%22automakers%22\u0026amp;f\u003dfalse page 9\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"By overpaying these engineers, the expenses of the domestic \u0027\u0027automakers\u0027\u0027 went up as well\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Joseph J. Fucini, \u0027Working for the Japanese\u0027, [http://books.google.com.au/books?id\u003dJUY6qFylW9IC\u0026amp;pg\u003dPA14\u0026amp;dq\u003d%22automaker%22%7C%22automakers%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dcv08U8b0DYbekgWPlIGgCQ\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22automaker%22%7C%22automakers%22\u0026amp;f\u003dfalse page 14\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Becoming president of the UAW when he did, Bieber inherited the task of organizing the plants that Japanese \u0027\u0027automakers\u0027\u0027 and suppliers had begun building in America in the early 1980s to circumvent the “voluntary quotas” the Japanese government had placed on exports to the United States\", \"priority\":10}]}, \"synonyms\":{}}");

