	add("automath", "{\"term\":\"automath\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who is self-taught; an autodidact\", \"priority\":1}]}, \"synonyms\":{}}");

	add("automation", "{\"term\":\"automation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From automatic (coined by a Ford Executive Vice President Delmar S. Harder in the 40s)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or process of converting the controlling of a machine or device to a more automatic system, such as computer or electronic controls\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027 October 23, David Leonhardt, \u0026quot;[http://www.nytimes.com/2012/10/24/us/politics/race-for-president-leaves-income-slump-in-shadows.html?_r\u003d1\u0026amp;hp],\u0026quot; \u0027New York Times\u0027 \u0026lt;small\u0026gt;(retrieved 24 October 2012)\u0026lt;/small\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The presidential campaign has been more focused on Bain Capital and an “apology tour” than on the challenges created by globalization and \u0027\u0027automation\", \"priority\":3}]}, \"synonyms\":{}}");

	add("automatism", "{\"term\":\"automatism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027automaton\u0027 + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Acting automatically or involuntarily\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An action performed subconsciously, without any apparent direction from the mind; a thought which appears spontaneously in one\u0027s consciousness\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1902\u0027\u0027, William James, \u0027The Varieties of Religious Experience\u0027, Folio Society 2008, p. 200\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"generalising this phenomenon, Mr Myers has given the name of \u0027\u0027\u0027automatism\u0027\u0027\u0027, sensory or motor, emotional or intellectual, to this whole sphere of effects, due to ‘uprushes’ into the ordinary consciousness of energies originating in the subliminal parts of the mind\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A surrealist painting technique whereby one attempts to move the brush, pen etc. without conscious control over it\", \"priority\":5}]}, \"synonyms\":{}}");

	add("automatization", "{\"term\":\"automatization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|automatize|ation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A process of making an action of a higher animal reflexive\", \"priority\":1}]}, \"synonyms\":{}}");

	add("automaton", "{\"term\":\"automaton\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) {{m|grc|αὐτόματον}}, neuter of {{m|grc|αὐτόματος||self moving, self willed}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A machine or robot designed to follow a precise sequence of instructions\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person who acts like a machine or robot, often defined as having a monotonous lifestyle and lacking in emotion\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Due to her strict adherence to her daily schedule, Jessica was becoming more and more convinced that she was an \u0027\u0027automaton\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A departure from principle in one instance becomes a precedent for a second, that second for a third, and so on \u0027til the bulk of the society is reduced to be mere \u0027\u0027automatons\u0027\u0027 of misery, to have no sensibilities left but for sinning and suffering.\u0027 - Thomas Jefferso\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A formal system, such as finite automaton\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A toy in the form of a mechanical figure\", \"priority\":6}]}, \"synonyms\":{}}");

	add("automixis", "{\"term\":\"automixis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From \u0027auto-\u0027 + Ancient greek (to 1453) \u0027μίξις\u0027 (mixing, i.e. fertilization)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of parthenogenesis in which two haploid gametes from the same meiosis combine\", \"priority\":1}]}, \"synonyms\":{}}");

	add("automobile", "{\"term\":\"automobile\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From French \u0027automobile\u0027 from Ancient greek (to 1453) \u0027αὐτός\u0027 (self) + French \u0027mobile|lang\u003dfr\u0027 () from Latin \u0027mobilis|lang\u003dla\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of vehicle designed to move on the ground under its own stored power and intended to carry a driver, a small number of additional passengers, and a very limited amount of other load. A car or motorcar.\u0026lt;!-- In contrast to a truck, an automobile is not designed to primarily carry cargo. An automobile may be powered by various means, such as an engine, battery and motor, some combination of the two, etc.--\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.americanscientist.org/issues/feature/2013/4/solvents-ethanol-car-crashes-amp-tolerance Solvents, Ethanol, Car Crashes \u0026amp; passage\u003dSurprisingly, this analysis revealed that acute exposure to solvent vapors at concentrations below those associated with long-term effects appears to increase the risk of a fatal \u0027\u0027automobile\u0027\u0027 accident. Furthermore, this increase in risk is comparable to the risk of death from leukemia after long-term exposure to benzene, another solvent, which has the well-known property of causing this type of cancer\", \"priority\":2}]}, \"synonyms\":{}}");

	add("automobilism", "{\"term\":\"automobilism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The use of automobiles\", \"priority\":1}]}, \"synonyms\":{}}");

	add("automorphism", "{\"term\":\"automorphism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|auto|morphism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An isomorphism of a mathematical object or system of objects onto itself\", \"priority\":1}]}, \"synonyms\":{}}");

	add("autonymy", "{\"term\":\"autonymy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The use of a symbol as a name for itself\", \"priority\":1}]}, \"synonyms\":{}}");

	add("autopathy", "{\"term\":\"autopathy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|auto|pathy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The philosophy that the cause of sickness in one individual is the same as the cause in another person\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An interaction where a species affects its own subsequent growth, especially negatively\", \"priority\":2}]}, \"synonyms\":{}}");

	add("autopay", "{\"term\":\"autopay\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|auto|pay|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"automatic paymen\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Rebecca Lai-Har Chiu, \u0027Professional Housing Management Practices in Hong Kong\u0027 (page 77\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Under the \u0027\u0027autopay\u0027\u0027 rent collection system, most of the transactions are effected on the first working day of the month\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Peter Sander, Jennifer Sander, \u0027573 Ways to Save Money\u0027 (page 236\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"it\u0027s easy to forget to examine your statements when \u0027\u0027autopay\u0027\u0027 is in place\", \"priority\":5}]}, \"synonyms\":{}}");

	add("autophagia", "{\"term\":\"autophagia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The eating of one\u0027s own body\", \"priority\":1}]}, \"synonyms\":{}}");

	add("autophagocytosis", "{\"term\":\"autophagocytosis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|auto|phagocytosis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"autophagy\", \"priority\":1}]}, \"synonyms\":{}}");

	add("autophagy", "{\"term\":\"autophagy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|auto|phagy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process of self-digestion by a cell through the action of enzymes originating within the same cell. Often a defensive and/or self-preservation measure\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A type of programmed cell death accomplished through self-digestio\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Self-consumption; the act of eating oneself\", \"priority\":3}]}, \"synonyms\":{}}");

	add("autophoresis", "{\"term\":\"autophoresis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|auto|phoresis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The spontaneous movement of particles in a suspension caused by nonlinear interplay between surface osmotic flows and solute advection\", \"priority\":1}]}, \"synonyms\":{}}");

