	add("autophosphorylation", "{\"term\":\"autophosphorylation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|auto|phosphorylation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The phosphorylation of a kinase protein catalyzed by its own enzymatic activity\", \"priority\":1}]}, \"synonyms\":{}}");

