	add("autopilot", "{\"term\":\"autopilot\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|auto|pilot|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mechanical, electrical, or hydraulic system used to guide a vehicle without assistance from a human being\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I set the \u0027\u0027autopilot\u0027\u0027 to due south, so I could get some rest\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A state of mind where one no longer thinks about doing one\u0027s actions, but acts mechanicall\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I\u0027ve been doing this 12 hours non-stop, and am so hungry and tired that I\u0027ve stopped thinking: I\u0027m now on \u0027\u0027autopilot\", \"priority\":4}]}, \"synonyms\":{}}");

	add("autoplay", "{\"term\":\"autoplay\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|auto|play|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any software feature that plays (a video, a compact disc, etc.) automatically\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, E. Ernst, \u0027The desktop guide to complementary and alternative medicine\u0027 (page 445\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"If you have not enabled \u0027\u0027autoplay\u0027\u0027, click on the CD icon that appears on your desktop, then click on \u0027CAM\u0027 to open the application\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Tony Bove, Cheryl Rhodes, \u0027iLife \u002704 all-in-one desk reference for dummies\u0027 (page 346\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"You can even combine the features and make a looping \u0027\u0027autoplay\u0027\u0027 DVD for a kiosk or self-running demo\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Steve Fulton, Jeff Fulton, \u0027HTML5 Canvas\u0027 (page 265\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Adding controls, looping, and \u0027\u0027autoplay\u0027\u0027 to an HTML5 video embed is simple\", \"priority\":7}]}, \"synonyms\":{}}");

	add("autoploidy", "{\"term\":\"autoploidy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of being autoploid\", \"priority\":1}]}, \"synonyms\":{}}");

	add("autopoiesis", "{\"term\":\"autopoiesis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027αὐτόποιος|lang\u003dgrc\u0027 () coined c. 1972 by Chilean biologists w:Humberto Maturana|Humberto Maturana and w:Francisco Varela|Francisco Varela\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Self creation; self organization\", \"priority\":1}]}, \"synonyms\":{}}");

	add("autoprocessing", "{\"term\":\"autoprocessing\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"enzymatic activity on the enzyme molecule itself\", \"priority\":1}]}, \"synonyms\":{}}");

	add("autoproteolysis", "{\"term\":\"autoproteolysis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|auto|proteolysis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Spontaneous proteolysis\", \"priority\":1}]}, \"synonyms\":{}}");

	add("autoprotolysis", "{\"term\":\"autoprotolysis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The autoionization of water (or similar compounds) in which a proton (hydrogen ion) is transferred to form a cation and an anion e.g. 2H\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;O \u003d\u0026gt; H\u0026lt;sub\u0026gt;3\u0026lt;/sub\u0026gt;O\u0026lt;sup\u0026gt;+\u0026lt;/sup\u0026gt; + OH\u0026lt;sup\u0026gt;-\u0026lt;/sup\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

