	add("autoradiography", "{\"term\":\"autoradiography\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process of making autoradiographs\", \"priority\":1}]}, \"synonyms\":{}}");

	add("autoredirection", "{\"term\":\"autoredirection\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|auto|redirection|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An) automatic redirection\", \"priority\":1}]}, \"synonyms\":{}}");

