	add("autorefractor", "{\"term\":\"autorefractor\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|auto|refractor|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An automated refractor used to prepare a prescription for glasses or contact lenses\", \"priority\":1}]}, \"synonyms\":{}}");

	add("autorefrigeration", "{\"term\":\"autorefrigeration\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|auto|refrigeration|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"refrigeration by storing a liquid at its boiling point for the pressure at which it is stored, so that, as vapour boils off, heat for the phase change cools the remaining liquid\", \"priority\":1}]}, \"synonyms\":{}}");

	add("autoregulation", "{\"term\":\"autoregulation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|auto|regulation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several physiological processes in which an inhibitory feedback system counteracts change\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The process that maintains a constant flow of blood to an organ despite changes in arterial pressure\", \"priority\":2}]}, \"synonyms\":{}}");

	add("autoresponder", "{\"term\":\"autoresponder\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|auto|responder|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A computer program that automatically sends a certain message or messages in response to incoming e-mail\", \"priority\":1}]}, \"synonyms\":{}}");

