	add("autosave", "{\"term\":\"autosave\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|auto|save|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A software facility that saves an open document periodically to avoid the risk of data loss\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Thanks to \u0027\u0027autosave\u0027\u0027, I was able to recover most of my unsaved thesis after a power cut\", \"priority\":2}]}, \"synonyms\":{}}");

	add("autoshaping", "{\"term\":\"autoshaping\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|auto|shaping|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An experimental procedure used to study classical conditioning by teaching a creature to respond to a stimulus\", \"priority\":1}]}, \"synonyms\":{}}");

	add("autosoliton", "{\"term\":\"autosoliton\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|auto|soliton|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A dissipative soliton; a stable solitary localized structure that arises in nonlinear spatially extended dissipative systems due to mechanisms of self-organization\", \"priority\":1}]}, \"synonyms\":{}}");

	add("autosome", "{\"term\":\"autosome\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"{{confix|auto|some|lang\u003den}}, from Ancient greek (to 1453) {{m|grc|σῶμα||body}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any chromosome other than sex chromosomes\", \"priority\":1}]}, \"synonyms\":{}}");

