	add("autostereogram", "{\"term\":\"autostereogram\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|auto|stereogram|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A single-image stereogram, designed to trick human eyes and brains into seeing a three-dimensional scene in a two-dimensional imag\", \"priority\":1}]}, \"synonyms\":{}}");

