	add("autostop", "{\"term\":\"autostop\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|auto|stop|lang\u003dit}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"hitchhiking\", \"priority\":1}]}, \"synonyms\":{}}");

	add("autostyly", "{\"term\":\"autostyly\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of being autostylic\", \"priority\":1}]}, \"synonyms\":{}}");

	add("autosuggestion", "{\"term\":\"autosuggestion\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|auto|suggestion|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The practice of suggesting thoughts to oneself, as in autohypnosis\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An instance of suggesting a thought to oneself\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An autosuggest feature\", \"priority\":3}]}, \"synonyms\":{}}");

	add("autotelism", "{\"term\":\"autotelism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The belief that an entity or event has within itself its own meaning or purpose\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In literature or art, the belief that a work, having been created, is a justification in and of itself. Poems with a unified rhetorical device to frame the poem in a singular idea\", \"priority\":2}]}, \"synonyms\":{}}");

