	add("autotransformer", "{\"term\":\"autotransformer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|auto|transformer|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a transformer with a single winding, output being taken from tap\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One of the principal features of the ordinary configurations of the transformer [...] is the electrical isolation that exists between the primary and secondary windings. [...] Whenever large transformation ratios are involved, safety demands that ordinary transformers be used. However, in instances where the transformation ratio is close to unity (which minimizes the hazard), a transformer employing a single tapped winding may be used with notable advantages.\u0026lt;br\u0026gt;[...] This arrangement is called the \u0027\u0027\u0027autotransformer\", \"priority\":2}]}, \"synonyms\":{}}");

