	add("autumn", "{\"term\":\"autumn\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) {{m|fro|automne}}, from Latin {{m|la|autumnus}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"File:Autumn leaves, Talcott Mountain State thumb|\u0027\u0027Autumn\u0027\u0027 in the United State\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Traditionally the third of the four seasons, when deciduous trees lose their leaves; typically regarded as being from September 24 to December 22 in parts of the Northern Hemisphere, and the months of March, April and May in the Southern Hemisphere\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dIn the \u0027\u0027autumn\u0027\u0027 there was a row at some cement works about the unskilled labour men. A union had just been started for them and all but a few joined. One of these blacklegs was laid for by a picket and knocked out of time\", \"priority\":3}]}, \"synonyms\":{}}");

